function Music() {
  let audio = new Audio("src/resources/02 Snoop Dogg - Gin & Juice.mp3")

  const start = () => {
    audio.play();
  }

  return (
    <audio>
      <source src="src/resources/02 Snoop Dogg - Gin & Juice.mp3" type="audio/mpeg"/>
    </audio>
  );
}

export default Music;
